import React,{useState} from 'react';
import '../../App.css';
import Footer from '../Footer';
import axios from 'axios';




const Register = () => {
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

 

  const handleSubmit = async (event) => {
    event.preventDefault();

   
    try {
      // send the email using axios
      const response = await axios.post("http://localhost:5001/register", {
        username,
        email,
        password
      });

      console.log(response.data); // log the response from the server
       // set the success status to true
    } catch (error) {
      console.error(error);
    }
  };
  
  return (
    <>
    <h1 className='services' >Register</h1><br/>
   
    <div className='container' >
    
      <h1>Register Here</h1><br/>

  <center>
 
  <form class="column g-3" onSubmit={handleSubmit}>
  <div class="col-md-6">
    {/* <label for="inputAddress" class="form-label">Full Name</label> */}
    <input type="text" class="form-control" name='username' 
    value={username}  onChange={(event) => setUsername(event.target.value)}  placeholder="Enter Your Full Name" required/>
  </div><br/>
  <div class="col-md-6">
    {/* <label for="inputEmail4" class="form-label">Email</label> */}
    <input type="text" class="form-control"  name='email'
     value={email}  onChange={(event) => setEmail(event.target.value)} placeholder="Enter Email" required/>
  </div><br/>
  <div class="col-md-6">
    {/* <label for="inputPassword4" class="form-label">Password</label> */}
    <input type="password" class="form-control"  name='password' value={password} onChange={(event) => setPassword(event.target.value)} placeholder="Enter Password" required/>
  </div><br/>
  <center>
  <div class="d-grid gap-1 col-3 mx-auto">
  <button class="btn btn-primary" type="submit">Sign up</button>
  {/* <button class="btn btn-primary" type="button">Button</button> */}
</div>
  </center>
</form>
    
<br/>
</center>

    </div><br/>
    <Footer/>
    </>
  )
};

export default Register;
